import Nav from '../components/Nav';
import styled from 'styled-components';

const Index = () => (
    <IndexLayOut>
        {/* <Nav />
        <h1>메인화면</h1> */}
        <NavLayout></NavLayout>
    </IndexLayOut>
);

const IndexLayOut = styled.div`
    height: 100%;
    min-width: 1400px;
    border: 1px solid black;
`;
const NavLayout = styled.div`
    height: 100vh;
    width: 320px;
    display: flex;
    /* min-height: 100vh; */
    /* min-width: 200px; */
    border: 1px solid blue;
`;
export default Index;
